# Import required libraries
from Crypto.Util.number import long_to_bytes, inverse

# Function to implement Franklin-Reiter related message attack
def franklin_reiter_related_message_attack(N, a, b, c1, c2):
    # Compute the differences
    x = (c1 - c2) % N
    y = (a - b) % N
    inv_y = inverse(y, N)
    m = (x * inv_y) % N
    return long_to_bytes(m)

